#!/bin/bash

SUCCESSFUL_CLONES="successful_clones.txt"
FAILED_CLONES="failed_clones.txt"

# $1 = clone url
# $2 = clone folder
# $3 = tag
function git_clone() {
  if [ ! -d $2 ]
  then
    GIT_TERMINAL_PROMPT=0 git clone $1 $2
    if [ ! $? -eq 0 ]
    then
      echo "Failed to clone " $1 " with exit code $?"
      echo $2 >> $FAILED_CLONES
      return $?
    fi
  else
    echo "Skipping, already cloned: " $1
  fi

  cd $2
  if [ ! $? -eq 0 ]
  then
    echo "Failed to cd into " $2
    echo $2 >> $FAILED_CLONES
    return $?
  fi

  git checkout $3
  if [ ! $? -eq 0 ]
  then
    echo "Failed to checkout " $1 " at commit " $3
    echo $2 >> $FAILED_CLONES
    cd ..
    return $?
  fi
  cd ..

  echo $2 >> $SUCCESSFUL_CLONES
}

rm $SUCCESSFUL_CLONES
rm $FAILED_CLONES

